// Mocks all files ending in `.vue` showing them as plain Vue instances
declare module '*.vue' {

  import Vue from 'vue';
  export default Vue;
}
declare module 'flipbook-vue';
declare module 'vue-json-viewer';
declare module 'vue-organization-chart';
declare module 'vue-echarts-v3';
declare module 'grapesjs';
declare module 'vue-grapesjs';
declare module 'vue-webdatarocks'




